 void setVAO(GLuint &VAO, GLuint &VBO, const float* vertices, size_t size) {
     glGenVertexArrays(1, &VAO);
     glGenBuffers(1, &VBO);
     glBindVertexArray(VAO);
     glBindBuffer(GL_ARRAY_BUFFER, VBO);
     glBufferData(GL_ARRAY_BUFFER, size, vertices, GL_STATIC_DRAW);
 
     // on the VAO, register the current VBO with the following vertex attribute layout:
     // - the stride length of the vertex array is 15 floats (15 * sizeof(float))
     // - layout location 0 (position) is 3 floats and starts at the first float of the vertex array (offset 0)
     // - layout location 1 (color + opacity) is 4 floats and starts at the fourth float (offset 3 * sizeof(float))
     // - layout location 2 (texcoord) is 2 floats and starts at the eighth float (offset 7 * sizeof(float))
     // - layout location 3 (normal) is 3 floats and starts at the tenth float (offset 9 * sizeof(float))
     // - layout location 4 (tangent) is 3 floats and starts at the thirteenth float (offset 12 * sizeof(float))
     glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 15 * sizeof(float), (void*) 0);
     glVertexAttribPointer(1, 4, GL_FLOAT, GL_FALSE, 15 * sizeof(float), (void*) (3 * sizeof(float)));
     glVertexAttribPointer(2, 3, GL_FLOAT, GL_FALSE, 15 * sizeof(float), (void*) (7 * sizeof(float)));
     glVertexAttribPointer(3, 2, GL_FLOAT, GL_FALSE, 15 * sizeof(float), (void*) (10 * sizeof(float)));
     glVertexAttribPointer(4, 3, GL_FLOAT, GL_FALSE, 15 * sizeof(float), (void*) (12 * sizeof(float)));
 
     // enable the layout locations so they can be used by the vertex shader
     glEnableVertexAttribArray(0);
     glEnableVertexAttribArray(1);
     glEnableVertexAttribArray(2);
     glEnableVertexAttribArray(3);
     glEnableVertexAttribArray(4);
 }
 
 // called by the main function to do initial setup, such as uploading vertex
 // arrays, shader programs, etc.; returns true if successful, false otherwise
 bool setup()
 {
     // upload the TAILS model to the GPU (explanations omitted for brevity)
     setVAO(tailsVAO, tailsVBO, tailsVertices, sizeof(tailsVertices));
     setVAO(sonicVAO, sonicVBO, sonicVertices, sizeof(sonicVertices));
     setVAO(knucklesVAO, knucklesVBO, knucklesVertices, sizeof(knucklesVertices));
     setVAO(chessVAO, chessVBO, chessVertices, sizeof(chessVertices));
 
     // load our shader program
     shader = gdevLoadShader("main.vs", "main.fs");
     if (! shader)
         return false;
     
     glUseProgram(shader);
 
     // load our texture
     tailsTex[0] = gdevLoadTexture("TailsTexture.png", GL_REPEAT, true, true);
     tailsTex[1] = gdevLoadTexture("TailsNormalMap.png", GL_REPEAT, true, true);
     tailsTex[2] = gdevLoadTexture("TailsSpecularMap.png", GL_REPEAT, true, true);
     if (! tailsTex[0] || ! tailsTex[1] || ! tailsTex[2])
         return false;
 
     sonicTex[0] = gdevLoadTexture("SonicTexture.png", GL_REPEAT, true, true);
     sonicTex[1] = gdevLoadTexture("SonicNormalMap.png", GL_REPEAT, true, true);
     sonicTex[2] = gdevLoadTexture("SonicSpecularMap.png", GL_REPEAT, true, true);
     if (! sonicTex[0] || ! sonicTex[1] || ! sonicTex[2])
         return false;
     
     knucklesTex[0] = gdevLoadTexture("KnucklesTexture.png", GL_REPEAT, true, true);
     knucklesTex[1] = gdevLoadTexture("KnucklesNormalMap.png", GL_REPEAT, true, true);
     knucklesTex[2] = gdevLoadTexture("KnucklesSpecularMap.png", GL_REPEAT, true, true);
     if (! knucklesTex[0] || ! knucklesTex[1] || ! knucklesTex[2])
         return false;
 
     chessTex[0] = gdevLoadTexture("ChessTexture.png", GL_REPEAT, true, true);
     chessTex[1] = gdevLoadTexture("ChessNormalMap.png", GL_REPEAT, true, true);
     chessTex[2] = gdevLoadTexture("ChessSpecularMap.png", GL_REPEAT, true, true);
     if (! chessTex[0] || ! chessTex[1] || ! chessTex[2])
         return false;
     
     glUniform1i(glGetUniformLocation(shader, "diffuseMap"), 0);
     glUniform1i(glGetUniformLocation(shader, "normalMap"),  1);
     glUniform1i(glGetUniformLocation(shader, "specularMap"), 2);
 
     // enable OpenGL blending so that texels with alpha values less than one are drawn transparent
     // (you can omit these lines if you don't use alpha)
     glEnable(GL_BLEND);
     glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);
 
     // the next line will enable z-buffer depth testing to properly draw objects on top of each other
     // (but wait, will this actually work properly with this demo?...)
     glEnable(GL_DEPTH_TEST);
     glEnable(GL_CULL_FACE);
 
     return true;
 }
 
 
